<?php
$queries = array();
parse_str($_SERVER['QUERY_STRING'], $queries);
$queries['cpf'] = preg_replace('/\D/', '', $queries['cpf']);
$queries['cpf'] = substr($queries['cpf'],0,3) . '.' . substr($queries['cpf'],3,3) . '.' . substr($queries['cpf'],6,3) . '-' . substr($queries['cpf'],9,2);
$queries['nome'] = ucwords(mb_strtolower($queries['nome']));

require_once 'dompdf/autoload.inc.php';

use Dompdf\Dompdf;
use Dompdf\Options;

$options = new Options();
$options->setIsHtml5ParserEnabled(true);
$options->set('isRemoteEnabled', true);
$options->setTempDir('temp');


$dompdf = new Dompdf($options);
//$dompdf->loadHtml('<p>Teste</p>');
$dompdf->loadHtml('<style> @page {margin: 0px 0px 0px 0px !important;padding: 0px 0px 0px 0px !important;}</style>
<p style="position: absolute; top: 42%; width: 100%; text-align: center; margin: 0 112px; font-family: -apple-system,BlinkMacSystemFont,Roboto,Oxygen-Sans,Ubuntu,Cantarell,sans-serif; font-size: 20px; color: white;  font-style: italic;
"><span style="font-size: 42px;">'. $queries['nome'] .'</span><br><br>Certificamos que '. $queries['nome'] .', CPF '. $queries['cpf'] .', participou da 4ª edição da Power Class Conexão, uma aula de 180 minutos, 100% online, realizada no dia 22 de junho de 2021, promovida pelo IBREP em parceria com o Corretor Conteúdo. <br>
Florianópolis, 22 de junho de 2021.  </p>
<img style="width: 100%" src="data:image/png;base64," alt="" />');

$dompdf->setPaper('A4', 'landscape');

$dompdf->render();

$dompdf->stream("ConexãoCertificado.pdf");